import Layout from '../components/Layout';

const Index = () => {
    <Layout>
        <h1> Welcome to my workshop</h1>
        <ul>
            <li>
                <a href="/about">About</a>
            </li>
        </ul>
    </Layout>
}

Index.getInitialProps = () => {
    fetch('https://api.myjson.com/bins/12jyvw')
    .then(res=> res.json)
    .then(json => {
        console.log(json);
    })

    return {};
}
